  false,\n\t\"url\": null,\n\t\"notes\": \"A detailed gravimetric geoid has been computed
  on a 10' by 10' grid for Canada by the University of New Brunswick. This data base
  was received in April 1989. Principal gravity parameters include latitude, east
  longitude, and total geoidial height above GRS'80 reference ellipsoid. The gravity
  data used for the spheroidal Stokes's integration consisted of point gravity anomalies
  for the innermost zone, of 5'x5' mean gravity anomalies for the inner zone, and
  1x1 degree mean gravity anomalies for the outer zone. The gravity values are based
  on the International Gravity Standardization Net 1971 (IGSN71) and the reference
  ellipsoid 1980 (GRS80). For detailed documentation see Technical Report No. 129.\",\n\t\"license_title\":
  null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\": \"[{\"name\":
